import React from 'react';
import styled from "styled-components";
import {Container, Subtitle} from "../../styles/common";

const StyledShop = styled(Container)`
  padding-bottom: 9rem;
  padding-top: 9rem;
  text-align: center;
  //display: flex;
  //flex-direction: column;
  //justify-content: center;
`

function Shop(props) {
  return (
    <StyledShop>
      <Subtitle>Categories</Subtitle>
    </StyledShop>
  );
}

export default Shop;
